let catalog = {"BB":{"name":"Песочницы","preview":"../catalog/euipment/BB/BB-08.01/Renders/BB-08.01_01.jpg","previewImg":"catalog/equipment/BB/BB-08.01/Renders/BB-08.01_01.jpg","previewText":"Песочницы для детских площадок","pageTitle":"Песочницы для детских игровых площадок","texts":["Одним из любимых элементов детской игровой площадки является песочница! Игры с песком относят к тактильным играм, в которых ребенок развивает эмоции и чувства, а также учится понимать свойства веществ. Например, мокрый песок легче принимает форму, а сухой – легче сыпется. Одни дети роют тоннели, другие – строят замки, третьи – лепят куличики, четвертые – \"просеивают\" муку для пирожков. Каждый найдет себе занятие по душе.","Разнообразие форм и цветовых решений песочниц Шелби поражает.","На небольшой игровой площадке лучше установить отдельно стоящую песочницу. Это сэкономит место, но разнообразит игровые элементы. Если пространства достаточно, подойдет комплекс для игр с песком, который включает в себя горку, домики и интерактивные конструкции."]},"IP":{"name":"Интерактивные панели","preview":"","previewImg":"catalog/equipment/IP/104103-0/Renders/1_280.JPG","previewText":"Интерактинвые панели для детских площадок","pageTitle":"Интерактив","texts":[]},"SW":{"name":"Качели","preview":"","previewImg":"catalog/equipment/SW/SZ-01.01 (КН-2890 )/Renders/SZ-01.01_тип1.jpg","previewText":"Качели для детских игровых площадок","pageTitle":"Купить качели для детских игровых площадок","texts":["Современные качели для детских площадок разнообразны по форме и конфигурациям. Это может быть отдельно стоящая конструкция, а может быть целый комплекс для качания.","Но неизменно одно – без качелей не обходится ни одна детская площадка!","Факторы, которые стоит учитывать при выборе вида качелей:","- соответствие конструкций возрасту детей;","- достаточная площадь в игровом пространстве с учетом зон безопасности для конкретной модели;","- устойчивость и прочность конструкции;","- экологичность материала качелей;","- безопасность."]},"VZ":{"name":"Модульные арки","preview":"","previewImg":"catalog/equipment/VZ/VZ-03.01/Renders/VZ-03.01_01.jpg","previewText":"Модульные арки для детских площадок","pageTitle":"Купить модульные арки","texts":[]},"LT":{"name":"WaterWays","preview":"","previewImg":"catalog/equipment/LT/LT-XS008/Render/LT-XS008_1.jpg","previewText":"Детское игровое оборудование для игры с водой и песком WaterWays","pageTitle":"WaterWays","texts":["Мы решили поднять игру с песком на новый уровень! Комплексы представляют с собой игровые конструкции, позволяющие проводить опыты с песком и водой прямо на детской площадке.","Игры на детской площадке – это не только развитие коммуникативных навыков между детьми и регулярные физические нагрузки. Как правило, в это момент у ребенка проходит период сенситивного развития. А сейчас вспомним одну известную фразу: «Бесконечно можно смотреть на три вещи: огонь, воду и на идеально слепленный кулич в песочнице!","Рецепт идеальной пропорции воды и песка передавался из поколения в поколения и держался в строжайшем секрете! А если тебе не повезло выйти на улицу без бутылки воды, то на помощь приходили альтернативные источники, в виде прорванной где-нибудь рядом трубы.","Мы решили поднять игру с песком на новый уровень и спроектировали иновационую линейку игровых комплексов «WaterWays».","Данные комплексы представляют с собой игровые конструкции, позволяющие проводить опыты с песком и водой прямо на детской площадке. Водяные мельницы, экскаваторы, насосы – и, вот, детская площадка превратилась в мир, оживших чертежей изобретений Да Винчи.","Бонусом для родителей: Довольное, но чумазое от песка лицо своего ребенка можно умыть, не отвлекаясь от игры!)"]},"WO":{"name":"Workout","preview":"","previewImg":"catalog/equipment/WO/WO-02.01/Renders/1.jpg","previewText":"Уличное спортивное оборудование Workout","pageTitle":"Купить уличное спортивное оборудование Workout","texts":["Workout – многофункциональное снаряжение для занятий спортом на свежем воздухе.","Воркаут как спортивное направление имеет пятнадцатилетнюю историю. В далеком 2008 году жители американских Гетто стали выходить на улицы и тренироваться, используя подручные конструкции. Например, бордюры, гидранты, ограждения, бетонные блоки. Это движение быстро набрало популярность и стало известно всему миру. Воркаут – это преимущественно силовые и кардио-тренировки, которые направлены на укрепление мышечного корсета и улучшение физического здоровья.","Очевидное преимущество \"уличного\" спорта в том, что он доступен каждому. Спортивные снаряды для занятий можно найти практически в каждом дворе, а заниматься – в свободное время и в любой сезон года.","Мы предлагаем оборудование для занятий спортом в актуальном исполнении, которое включает в себя комфорт, практичность и многофункциональность.","Линейка оборудования Workout оптимальна для установки в парках, скверах, на придомовых территориях и стадионах.","Отдельные элементы или целые спортивные комплексы можно купить на нашем сайте, оставив заявку в специальной форме ниже."]},"GP":{"name":"Геопластика","preview":"","previewImg":"catalog/equipment/ST/STK39-4440-765/Renders/STK39-4440-765.jpg","previewText":"Линейка оборудования для геопластики на детских игровы площадках","pageTitle":"Купить геопластику для детей","texts":["Шелби Гео - она же геопластика, исскуственно созданные рельефы и неровности для детской игровой площадки.","Будущее нельзя предвидеть, но можно изобрести. И вот то самое будущее мы видим в искусственном изменении рельефа, в более выразительной и функциональной планировке пространства.","Уверены, вы догадались, что речь идет о геопластике - искусственные холмы с горками, с элементами скалодромов, зацепами и лазами.","Фантазия детей безгранична, а наши специалисты по геопластичным изделиям готовы создать что-то необычное, креативное и индивидуальное. А все потому что детство в приоритете."]},"ST":{"name":"Горки и скаты","preview":"","previewImg":"catalog/equipment/ST/STK39-4440-765/Renders/STK39-4440-765.jpg","previewText":"Горки из нержавеющей стали для детских площадок","pageTitle":"Купить горки из нержавеющей сьали","texts":["Собственное производство горок и скатов для детских игровых площадок"]},"S":{"name":"Музыкальные инструменты","preview":"","previewImg":"catalog/equipment/S/S04-830/Renders/S04-830_01.jpg","previewText":"Детские музыкальные инструменты для детских площадок","pageTitle":"Музыкальные инструменты","texts":[]},"AT":{"name":"Атом","preview":"","previewImg":"catalog/playgrounds/AT/AT-07.01/Рендеры/АТ-07.01_01.jpg","previewText":"Линейка детских канатных комплексов Atom","pageTitle":"Детские канатные комплексы Атом","texts":["Серия ATOM – игровое оборудование, в котором реализованы новаторские инженерные находки и дизайнерские решения. Серия включает канатные сетки-лабиринты, которые крепятся к металлическому каркасу. Каждая модель – неповторимая геометрическая фигура, сложная и многогранная.","Игровые канатные комплексы серии ATOM помогут преодолеть страх высоты и восполнить недостаток физической активности.","Благодаря линейке детских канатных комплексов Шелби Атом дети посмотрят на мир через линзу микроскопа. И не только посмотрят, но и потрогают! Ведь в этой серии игрового оборудования реализованы удивительные инженерные находки на основе атомных элементов.","Хотели бы вы побывать внутри молекулы метана тетраэдрической структуры? Или пройти канатный сетчатый лабиринт внутри молекулы Бора?","Каждую игровую конструкцию линейки Атом мы представили в виде уникальных строений существующих и выдуманных молекул. Расположившись на территории игровой площадки, игровые элементы напоминают химическую лабораторию, в которой идет бурная научная деятельность по изучению атомного состава элементов.","Одни маленькие ученые, собирают консилиум для спасения мира от неизвестного вируса и отправляются прямиком внутрь молекулы, где их ждет испытание канатным лабиринтом из армированного полипропиленового 6-прядного каната диаметром 16 мм, который соединен между собой в пространственную сеть при помощи алюминиевых обжимных гильз из полиамида. Другие спасают мир от голода, открыв уникальный атом мгновенного роста растений, состоящий из специальных алюминиевых полусфер с защитными металлическими крышками, обработанный специальным порошковым покрытием.","Благодаря разнообразности форм и размеров детская площадка становится центром инновационных технологий и притягивает взгляды будущих химиков, биологов и ученых!"]},"FO":{"name":"Force","preview":"","previewImg":"catalog/playgrounds/FO/FO-01.01/Renders/FO-01.01.jpg","previewText":"Force - спортивное оборудование и тренажеры","pageTitle":"Купить тренажеры для детских площадок","texts":[]},"GL":{"name":"Globus","preview":"","previewImg":"catalog/playgrounds/GL/GL-01.01/renders/GL-01.00_01.jpg","previewText":"Игровые канатные комплексы для детских площадок Globus","pageTitle":"Купить игровые канатные комплексы для детских площадок Globus","texts":["GLOBUS – неповторимые конструкции канатных комплексов. Серия вдохновляет и стимулирует детей играть, исследовать пространство и выполнять физические упражнения.","В детстве мы смотрели в небо, разглядывали крошечные звезды и мечтали о космосе. Вдохновленные космическим пространством, стремящимся к бесконечности, мы спроектировали линейку игровых канатных комплексов для детских площадок Глобус.","Футуристичность детских площадок с канатными конструкциями Глобус привлекает детей всех возрастов. Сферическая форма игровых элементов напоминает планеты солнечной системы, а цилиндрические конструкции игровых комплексов – детали космического корабля.","Пробираясь сквозь запутанные канатные цепи или проверяя прочность вестибулярного аппарата на балансирах, дети учатся чувствовать свое тело и управлять им.","Мы считаем, что первое космическое приключение ребенка должно начинаться с детской площадки во дворе!"]},"LA":{"name":"Lago","preview":"","previewImg":"catalog/playgrounds/LA/LA-00.08/Renders/1.jpg","previewText":"Детские игровые комплексы из клееного бруса Lago","pageTitle":"Купить детские игровые комплексы из клееного бруса Lago","texts":["Детские игровые комплексы из деревянного клееного бруса Шелби Лаго. Удивительное сочетание привычных нашему взгляду детских площадок и разнообразных геометрических фигур, которая позволит детям развить мелкую и общую моторику и осознать многогранность окружающего мира.","Обилие канатных плетений и простота прочных деревянных элементов, все это даст отличный старт юным исследователям! Игровой комплекс для лазанья из гнутого бруса подойдет в качестве хорошего тренажера для развития детской координации."]},"LE":{"name":"Legno","preview":"","previewImg":"catalog/playgrounds/LE/LE-01.01/Renders/PNG/LE-01.01_1.png","previewText":"Детские игровые комплексы из робинии Legno","pageTitle":"Купить детские игровые комплексы из робинии Legno","texts":["Детские игровые комплексы из робинии Шелби Легно – это не только минимализм и классический вид деревянных конструкций, но и возможности для развития безграничной детской фантазии. Простота конструкций позволит родителям быть уверенными в безопасности своего ребенка, а используемые при изготовлении материалы увеличивают стойкость наших игровых площадок к любым климатическим условиям. Обилие различных деталей также не оставит никого равнодушным.","Балансиры из прочного дерева, игровые комплексы с канатными переходами – все это станет первым шагом на пути к исследованию мира. Особенностями Шелби Легно являются возможности комбинирования отдельных элементов между собой и создания своего индивидуального игрового комплекса с качелями, песочницами и горками!"]},"MN":{"name":"Монстерс","preview":"","previewImg":"catalog/playgrounds/MN/MN-01.01/Renders/3_1.jpg","previewText":"Линейка детского игрового оборудования для самых маленьких 3-7 лет (для детских садов) Монстерс","pageTitle":"Купить детское игровое оборудование Монстерс","texts":["Серия Monsters – оптимальное решение для игровых пространств в детских садах и дошкольных учреждениях. Яркий дизайн, мультипликационные персонажи, разнообразие игровых элементов – основа игрового комплекса.","Спортивно-игровые комплексы этой серии предназначены для детей от 3 лет. Игровые конструкции, разработанные специально для малышей, помогают развивать координацию, стимулируют ходьбу и желание познавать мир.","С помощью игровых комплексов этой серии можно разнообразить территории дошкольных учреждений и детских площадок. Игра на детских комплексах Шелби Монстерс будет яркой, интересной, разнообразной и поможет детям проявить фантазию.","Уникальная конструкция детских комплексов позволяет детям играть в двигательные и спортивные игры. На нашем сайте можно выбрать любую готовую конструкцию или спроектировать неповторимую площадку в индивидуальном порядке. Яркие цвета и забавные герои не оставят никого равнодушными!"]},"PY":{"name":"Pyramid","preview":"","previewImg":"catalog/playgrounds/PY/PY-00.01/Рендеры/PY-00.01.jpg","previewText":"Канатные комплексы пирамидальной формы Pyramid","pageTitle":"Купить канатные комплексы пирамидальной формы Pyramid","texts":["В данной серии собраны канатные конструкции пирамидальной формы, они имеют пологий склон у основания и острую вершину. Внутри такой конструкции дети всегда найдут точки опоры для ног или удобного хвата руками.","Серия вдохновляет детей на совместную игру, позволяет активно исследовать пространство и выполнять физические упражнения."]},"QU":{"name":"Qubix","preview":"","previewImg":"catalog/playgrounds/QU/QU-00.01/Renders/QU-00.01 (2).jpg","previewText":"Спортивно-развивающие комплексы для детей Qubix","pageTitle":"Купить спортивно-развивающие комплексы для детей Qubix","texts":["Детские спортивные игровые комплексы Кубикс – это система лабиринтов с несколькими уровнями и различными препятствиями на каждом из них.","Зачастую, при слове «Лабиринт» первой ассоциацией у людей будет запутанная система входов и выходов. А что если мы скажем, что по изначальной задумке лабиринт имел только один маршрут и в нем не существовало неправильных поворотов!","Первые конструкции создавались как один из способов медитации, а скандинавы верили, что найдя выход, они с легкостью преодолеют все жизненные трудности и им всегда будет сопутствовать удача!","Вдохновившись этим наблюдением, мы сконструировали детские спортивные комплексы так, чтобы каждый ребенок мог пройти его от начала до конца без каких-либо затруднений. И вместе с тем, дополнительные игровые элементы и конструкции помогли восполнить физическую активность, преодолеть страх высоты.","Благодаря металлической сетке можно быть уверенным в безопасности детей на территории наших игровых площадок.","Несущий каркас спортивных комплексов выполнен из металлических труб с защитным порошковым покрытием. По периметру корпус закрыт защитной металлической оцинкованной сеткой. Полы и вертикальные перегородки выполнены из ламинированной фанеры. Канатные части состоят из полипропиленового армированного каната, соединения канатов – из полиамида. Туннельные переходы и горки выполнены из пластика и соединены опорными стойками из труб.","В зависимости от размера благоустраиваемой территории конструкции могут быть укомплектованы горками разной сложности и высоты.","Во время игр дети будут учиться договариваться и искать совместные решения, играть в коллективе, развивать воображение, укреплять мышцы, тренировать ловкость и координацию."]},"RI":{"name":"River","preview":"","previewImg":"catalog/playgrounds/RI/RI -01.11/Рендеры/КН-2626_01.jpg","previewText":"Линейка детских больших канатных комплексов River","pageTitle":"Купить большие канатные комплексы River","texts":["Серия «Ривер» – идеальное решение для больших игровых пространств в парках, скверах, на придомовых территориях. В моделях этой серии плоская или объемная канатная сетка с множеством игровых элементов занимает центральное место на игровой площадке.","С помощью канатных комплексов «Ривер» можно разнообразить занятия спортом, сделать игру увлекательной и интересной, помочь детям проявить фантазию."]},"SK":{"name":"Skat","preview":"","previewImg":"catalog/playgrounds/SK/SK-01.01/Рендеры/КН-00661_01.jpg","previewText":"Линейка детских канатных комплексов Skat","pageTitle":"Купить детские канатные комплексы Skat","texts":["Канатные комплексы этой серии максимально насыщают пространство в пределах выделенной площади. Несущий элемент – центральная опора, а четыре или более опоры поддерживают объемную форму канатной конструкции.","Конструкции этой серии способствуют развитию ловкости, силы и координации движений, помогают преодолеть страх высоты и восполнить недостаток физической активности в современных городских условиях.","По статистике каждый 3 человек страдает арахнофобией (боязнь пауков), при этом паутина является предметом бесконечных исследований и любопытства со стороны ученых. Все дело в ее высокой прочности!","Что же касаемо других удивительных факторов, так это структура каждой сплетенной паутины. Все дело в том, что строение паутины, как и снежинки абсолютно разное!","Именно наблюдение за главной работой пауков натолкнуло нас на мысль создать свою линейку канатных конструкций, объединенных одной концепцией, но абсолютно не похожие друг на друга. Так и появились Детские канатные комплексы  Скат - игровые элементы, состоящие из плотно натянутой канатной сетки, которые крепятся к опорным стойкам в виде металлических труб диаметром 133 мм.","Один из интересных фактов: На прочность паутины влияют свет, температура и влажность, поэтому прямые солнечные лучи еще больше ослабят соединения нитей между собой и сделают паутину менее прочной. Чего не скажешь о нашей «паутине», ведь она представляет собой цветной шестипрядный канат, армированный стальной проволокой диаметром 16 мм. Для фиксации каната применяются s-образные крючки из нержавеющей стали, а также стальные оцинкованные коуши и алюминиевые обжимные втулки, что обеспечивает нашей конструкции максимальную прочность.","Простота и лаконичность данного игрового оборудования позволяет установить детскую площадку самостоятельно, ведь в комплект также входит подробная инструкция по монтажу.","Детский игровой комплекс  Скат, станет отличным дополнением к основной площадке и восполнит недостаток физической активности в современных городских условиях."]},"TW":{"name":"Loop","preview":"","previewImg":"catalog/playgrounds/TW/TW-01.01/Renders/PNG/TW-01.01_PNG.png","previewText":"Линейка детских канатных башен Loop","pageTitle":"Купить линейку детских канатных башен Loop","texts":["Серия Loop – идеальное решение для больших игровых пространств в парках, скверах, придомовых территориях. Здесь высокие канатные башни со множеством уровней занимает центральное место на игровой площадке.","С помощью канатных башенных комплексов этой серии можно разнообразить занятия спортом, сделать игру увлекательной и интересной, помочь детям проявить фантазию. От высоты канатных башен захватывает дух."]},"UF":{"name":"UFO","preview":"","previewImg":"catalog/playgrounds/UF/UF-01.01/Renders/КН-1335_01.jpg","previewText":"Линейка детских канатных комплексов UFO","pageTitle":"Купить линейку детских канатных комплексов UFO","texts":["Серия включает оригинальные канатные конструкции для совместных игр множества детей разных возрастов. Дополнительные элементы в виде канатных туннелей, лестниц, наклонных сеток разных форм – это база для активного движения и развития ловкости.","Серия НЛО – надежное и безопасное оборудование для детей любого возраста. Это отличная возможность сделать игровую площадку еще более функциональной и интересной, а также подарить незабываемые положительные эмоции детям."]},"WH":{"name":"Indy","preview":"","previewImg":"catalog/playgrounds/WH/WH-01.02/Renders/WH-01.02_01.jpg","previewText":"Линейка детских канатных башен Indy","pageTitle":"Купить линейку детских канатных башен Indy","texts":["Серия Indy – Кто в детстве строил шалаш и лазил по деревьям? Мы все: бумеры, миллениалы, зумеры или поколения X, Y, Z, так вот, к чему это все, линейка детских игровых комплексов серии Шелби Инди это своего рода шалашы и деревья для современных детей. Здесь высокие канатные башни со множеством уровней, отдельные игровые узлы, горки и скаты из нержавеющей стали, канатные лазы, лестницы и скалодромы. Игровые комплексы серии Инди будут долго служить центром притяжения для детей и их родителей на детской площадке во дворе, парке или других общественных территориях."]},"MO":{"name":"Готовые решения","preview":"","previewImg":"catalog/solutions/MO/MO-12.01/Renders/ver_01.1_new.jpg","previewText":"Готовые решения для детских игровых площадок","pageTitle":"Купить готовые решения для детских игровых площадок","texts":[]}};